import React from "react";
import { useState, useEffect } from "react";

export default function News() {
  const [post, setPost] = useState([]);

  useEffect(() => {
    fetch(
      "https://newsapi.org/v2/everything?q=tesla&from=2022-05-09&sortBy=publishedAt&apiKey=14ca7051b89b45fca6adf6fc35da4824"
    ).then((response) =>
      response.json().then((data) => setPost(data.articles))
    );
  }, []);

  post.forEach((article) => {
    console.log(article.content);
  });
  return (
    <div className="bg-gray-700 h-auto border-[1px] border-gray-600 mt-[100px] max-w-[1400px] mx-auto">
      <h1 className="text-3xl text-gray-400 underline">NEWS</h1>

      {post.map((post) => (
        <div className="w-[500px]">
          <h1 className="text-2xl">{post.title}</h1>
          <p>{post.content}</p>
        </div>
      ))}
    </div>
  );
}
